[{"operationName":"CDPPageQuery","variables":{"slug":"state-estimation-localization-self-driving-cars"},"query":"query CDPPageQuery($slug: String!) {
  XdpV1Resource {
    slug(productType: "COURSE", slug: $slug) {
      elements {
        name
        id
        slug
        xdpMetadata {
          __typename
          ... on XdpV1_cdpMetadataMember {
            cdpMetadata {
              id
              avgLearningHoursAdjusted
              cmlLearningObjectives {
                ... on XdpV1_cmlMember {
                  cml {
                    value
                    dtdId
                    __typename
                  }
                  __typename
                }
                __typename
              }
              cmlRecommendedBackground {
                ... on XdpV1_cmlMember {
                  cml {
                    value
                    dtdId
                    __typename
                  }
                  __typename
                }
                __typename
              }
              level
              degrees {
                degree {
                  name
                  shortName
                  slug
                  headerImage
                  __typename
                }
                __typename
              }
              certificates
              courseStatus
              domains {
                domainId
                domainName
                subdomainName
                subdomainId
                __typename
              }
              averageContentSatisfactionScore
              contentSatisfactionRatingsCount
              primaryLanguages
              skills
              photoUrl
              subtitleLanguages
              name
              slug
              description
              workload
              topReviews {
                comment
                authorName
                averageFiveStarRating
                timestamp
                __typename
              }
              reviewHighlights {
                highlightText: highlighttext
                reviewcount
                __typename
              }
              testimonials {
                comment
                job
                authorName: author
                credential
                __typename
              }
              learningOutcomes {
                careerOutcomePromotion
                careerOutcomeNewCareer
                careerOutcomePayIncrease
                careerOutcomeStartBusiness
                tangibleCareerOutcome
                topOccupation
                __typename
              }
              ratings {
                averageFiveStarRating
                ratingCount
                commentCount
                __typename
              }
              level
              badges
              partners {
                id
                name
                shortName
                landingPageBanner
                description
                partnerMarketingBlurb
                logo
                squareLogo
                rectangularLogo
                classLogo
                primaryColor
                secondaryColor
                accentColor
                productBrandingLogo
                __typename
              }
              averageInstructorRating
              instructorRatingCount
              instructors {
                id
                fullName
                photo
                title
                shortName
                department
                learnersReached
                coursesTaught
                isTopInstructor
                __typename
              }
              cmlFaqs {
                question {
                  ... on XdpV1_cmlMember {
                    cml {
                      dtdId
                      value
                      __typename
                    }
                    __typename
                  }
                  __typename
                }
                answer {
                  ... on XdpV1_cmlMember {
                    cml {
                      dtdId
                      value
                      __typename
                    }
                    __typename
                  }
                  __typename
                }
                __typename
              }
              material {
                weeks {
                  modules {
                    id
                    name
                    description
                    totalVideos
                    totalQuizzes
                    totalDuration
                    totalLectureDuration
                    totalReadings
                    items {
                      id
                      duration
                      name
                      typeName
                      slug
                      __typename
                    }
                    __typename
                  }
                  __typename
                }
                __typename
              }
              primaryS12n {
                id
                name
                courseCount
                slug
                badges
                subheader
                headline
                description
                isCertificate
                productVariant
                domains {
                  domainId
                  domainName
                  subdomainName
                  subdomainId
                  __typename
                }
                courses {
                  id
                  name
                  slug
                  __typename
                }
                partners {
                  id
                  name
                  shortName
                  landingPageBanner
                  description
                  partnerMarketingBlurb
                  logo
                  squareLogo
                  rectangularLogo
                  primaryColor
                  secondaryColor
                  accentColor
                  productBrandingLogo
                  __typename
                }
                __typename
              }
              s12ns {
                id
                name
                courseCount
                slug
                badges
                subheader
                headline
                description
                productVariant
                domains {
                  domainId
                  domainName
                  subdomainName
                  subdomainId
                  __typename
                }
                courses {
                  id
                  name
                  slug
                  __typename
                }
                partners {
                  id
                  name
                  shortName
                  landingPageBanner
                  description
                  partnerMarketingBlurb
                  logo
                  squareLogo
                  rectangularLogo
                  primaryColor
                  secondaryColor
                  accentColor
                  productBrandingLogo
                  __typename
                }
                __typename
              }
              __typename
            }
            __typename
          }
        }
        __typename
      }
      __typename
    }
    __typename
  }
  OnDemandCoursesV1Resource {
    slug(slug: $slug) {
      elements {
        id
        overridePartnerLogos
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
